// src/components/Home.js
import React from 'react';

const technicalSkills = [
  { name: 'HTML5', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/html5/html5-original.svg' },
  { name: 'CSS3', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/css3/css3-original.svg' },
  { name: 'JavaScript', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/javascript/javascript-original.svg' },
  { name: 'Python', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/python/python-original.svg' },
  { name: 'Java', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/java/java-original.svg' },
  { name: 'jQuery', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/jquery/jquery-original.svg' },
  { name: 'ASP.NET', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/dot-net/dot-net-original.svg' },
  { name: 'SQL', img: 'https://cdn-icons-png.flaticon.com/512/2772/2772128.png' },
  { name: 'MySQL', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/mysql/mysql-original.svg' },
  { name: 'Oracle', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/oracle/oracle-original.svg' },
  { name: 'WordPress', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/wordpress/wordpress-original.svg' },
  { name: 'Shopify', img: 'https://cdn-icons-png.flaticon.com/512/5968/5968906.png' },
  { name: 'AWS', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/amazonwebservices/amazonwebservices-original-wordmark.svg' },
  { name: 'Azure', img: 'https://cdn.jsdelivr.net/gh/devicons/devicon/icons/azure/azure-original.svg' },
  { name: 'GCP', img: '/logo/googlecloud.png' },
  { name: 'Office 365', img: '/logo/office365.jpg' },
  { name: 'Google Charts', img: '/logo/googlecharts.png' },
  { name: 'Draw.io', img: '/logo/drawio.png' }
];

const Home = () => {
  const sectionStyle = {
    backgroundColor: '#111',
    color: '#eee',
    padding: '2rem',
    marginBottom: '2rem',
    borderRadius: '8px',
  };

  return (
    <div>
      {/* Hero Section */}
      <section id="hero" style={sectionStyle}>
        <h2>Welcome</h2>
        <p>Welcome to Swarnim's Portfolio!</p>
      </section>

      {/* Career Objective */}
      <section id="career-objective" style={sectionStyle}>
        <h2>Career Objective</h2>
        <p>
          Graduate in Bachelor of Information Technology from Melbourne Polytechnic with
          industry-based project experience. Experienced in Python, WordPress, HTML5, CSS,
          and JavaScript. Previously an IT Software Developer intern at 10th Dan, Melbourne.
          Currently a Multi-Site Store Manager with 5 years customer service experience.
          Seeking to develop an IT career and skillset.
        </p>
      </section>

      {/* Technical Skills */}
      <section id="technical-skills" style={sectionStyle}>
        <h2>Technical Skills</h2>
        <div
          style={{
            display: 'flex',
            flexWrap: 'wrap',
            gap: '1rem',
            alignItems: 'center',
            marginBottom: '1rem',
          }}
        >
          {technicalSkills.map(skill => (
            <div
              key={skill.name}
              style={{ textAlign: 'center', width: 80, color: '#eee' }}
              title={skill.name}
            >
              <img
                src={skill.img}
                alt={skill.name}
                style={{ width: 50, height: 50, objectFit: 'contain' }}
              />
              <div style={{ fontSize: '0.8rem', marginTop: '0.3rem' }}>{skill.name}</div>
            </div>
          ))}
        </div>
      </section>

      {/* Education */}
      <section id="education" style={sectionStyle}>
        <h2>Education</h2>
        <p><strong>Bachelor of Information Technology (Software Development)</strong></p>
          <img
              src="/logo/mp.jpg"
              alt="Melbourne Polytechnic"
              style={{ height: 30, marginLeft: 10, verticalAlign: 'middle' }}
            />
        <p>Melbourne Polytechnic, July 2019 – July 2022</p>
      </section>

      {/* Professional Development */}
      <section id="professional-development" style={sectionStyle}>
        <h2 style={{ marginBottom: '1.5rem' }}>Professional Development</h2>
        <div
          style={{
            display: 'flex',
            flexWrap: 'wrap',
            gap: '1.5rem',
            justifyContent: 'flex-start',
          }}
        >
          {[
            {
              name: 'Professional Year (Oct 2022 – Apr 2023), Performance Education',
              img: '/logo/pe.png',
            },
            {
              name: 'AWS Cloud Practitioner Essentials, AWS Training',
              img: '/logo/aws.png',
            },
            {
              name: 'Google Professional Cloud Developer Certificate',
              img: '/logo/gcpd.png',
            },
            {
              name: 'Business Analysis and Process Management, Coursera',
              img: '/logo/c.png',
            },
            {
              name: 'Marketing Tools: Social Media, LinkedIn Learning',
              img: '/logo/linkedin.png',
            },
            {
              name: 'Software Development Analytics Certification, SAS',
              img: '/logo/sas.png',
            },
            {
              name: 'Web Page Development Certification, Alison',
              img: '/logo/alison.jpg',
            },
            {
              name: 'Database Foundations, LinkedIn Learning',
              img: '/logo/linkedin.png',
            },
            {
              name: 'Salesforce Developer AI Introduction, Alison',
              img: '/logo/alison.jpg',
            },
            {
              name: 'Diploma in HTML5, CSS3, JavaScript and Python, Alison',
              img: '/logo/alison.jpg',
            },
          ].map((cert) => (
            <div
              key={cert.name}
              style={{
                backgroundColor: '#222',
                borderRadius: 10,
                boxShadow: '0 4px 12px rgba(0,0,0,0.7)',
                padding: '1rem 1.2rem',
                width: 320,
                display: 'flex',
                alignItems: 'center',
                gap: '1rem',
                cursor: 'default',
                transition: 'transform 0.25s ease, box-shadow 0.25s ease',
              }}
              onMouseEnter={e => {
                e.currentTarget.style.transform = 'scale(1.05)';
                e.currentTarget.style.boxShadow = '0 8px 20px rgba(0,0,0,0.9)';
              }}
              onMouseLeave={e => {
                e.currentTarget.style.transform = 'scale(1)';
                e.currentTarget.style.boxShadow = '0 4px 12px rgba(0,0,0,0.7)';
              }}
            >
              <img
                src={cert.img}
                alt={cert.name}
                style={{
                  height: 45,
                  width: 45,
                  objectFit: 'contain',
                  borderRadius: 6,
                  boxShadow: '0 0 8px rgba(255,255,255,0.1)',
                }}
              />
              <p style={{ color: '#eee', fontSize: '0.9rem', margin: 0, fontWeight: 500 }}>
                {cert.name}
              </p>
            </div>
          ))}
        </div>
      </section>


      {/* References */}
      <section id="references" style={sectionStyle}>
        <h2>References</h2>
        <p><strong>Brandy Sahagun</strong> - Area Manager, Fossil Australia</p>
        <p>Email: bsahagun@fossil.com | Phone: 0431507535</p>
        <p><strong>Sujan Lama Tamang</strong> - Professional Year Colleague</p>
        <p>Email: lamasujan221@gmail.com | Phone: 0424142435</p>
      </section>
    </div>
  );
};

export default Home;
